import React from "react";
import Logo from "../images/logo.png";
import { Nav, Navbar } from "react-bootstrap";
import "./style.css";
import { FaUserCircle, BsSearch, FiMenu } from "react-icons/fa";

export default function Main() {
  return (
    <>
      <Navbar bg="light" variant="light">
        <Navbar.Brand href="home">
          <img src={Logo} width="200px"></img>
        </Navbar.Brand>
        <Nav className="mr-auto">
          <Nav.Link href="transitionalplanning">Transitional Planning</Nav.Link>
          <Nav.Link href="alternativepaths">Alternative Paths</Nav.Link>
          <Nav.Link href="community">Community</Nav.Link>
        </Nav>
        <FaUserCircle style={{ color: "gray" }} size={40} />
        <i class="far fa-bars"></i>
        <FiMenu style={{ color: "gray" }} size={40} />
      </Navbar>
    </>
  );
}
